import React from 'react';
import './Card.css';
import posed, {PoseGroup} from 'react-pose';

const MainCard = posed.div({
    enter: {
      y:0
    },
    exit: { y:50 },
    duration:'1000ms'
  });


const Card = ({children}) =>{
    return(
        <div className="outerCard">
            {children}
        </div>
    )
}

export default Card;
